import axios from 'axios'
import React from 'react'

class Photos extends React.Component {
    constructor() {
        super()
        this.state = {
            photos: []
        }
    }

    componentWillMount() {
        axios.get('http://127.0.0.1:8000/api/photos')
            .then(res => {
                this.setState({ photos: res.data })
            })
            .catch(error => {
                console.log(error.response)
            })
    }

    render() {
        return(
            <>
                Composant photos
            </>
        )
    }
}

export default Photos
